import React from "react";
import { Box } from "@mui/material";
import ChatHeader from "./ChatHeader";
import Messages from "./Messages";
import Footer from "./Footer";

const ChatBox=()=>{
    return (
        <Box style={{height: "75%"}}>
            <Box>
                <ChatHeader />
                <Messages />
                <Footer />
            </Box>
        </Box>
    );
}

export default ChatBox;
